import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import Card from "./Cards";
import Sdata from "./Sdata";
function ncard(val) {
  return (
    <Card
    key={val.key}
      imgsrc={val.imgsrc}
      title={val.title}
      mname={val.mname}
      link={val.link}
    />
  );
}
ReactDOM.render(
  <>
    <App/>
  </>,
  document.getElementById("root")
);
